import React, { useState } from 'react';
import './ProfilePage.css';

const ProfilePage = () => {
	const [onProfile, setOnProfile] = useState({
		onProfile: true
	});
	return (
		<div>
			<h2>Profile Page</h2>
			<div>Profile Image</div>
			<div className='profileContent'>
				<div className='profileHeader'></div>
				<div></div>
			</div>
		</div>
	);
};

export default ProfilePage;
